import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faPlus, faCircleCheck, faEllipsisV, faPenToSquare } from "@fortawesome/free-solid-svg-icons";
import { faXmarkCircle } from "@fortawesome/free-regular-svg-icons";
import Modules from "../Modules";
import './style.css'

export default function Home() {
  library.add(faXmarkCircle, faCircleCheck);
  const black = {
    "color": "black"
  }

  return (
    <div className='d-flex flex-row'>
      <div className="page-body-inner flex-fill">
        <Modules />
      </div>
      <div className="right-sidebar">
        <div className="d-flex flex-column">
          <div>Course Status</div>
          <div className="d-flex flex-row mb-3 ">
            <button type="button" class="btn btn-secondary flex-fill" onclick="">
              <FontAwesomeIcon icon="fa-regular fa-circle-xmark" />
              Unpublish
            </button>
            <button type="button" class="btn btn-success flex-fill" disabled onclick="">
              <FontAwesomeIcon icon={faCircleCheck} style={black} />
              Published
            </button>
          </div>
        </div>
      </div>

    </div>
  );
}
